insert  into `web_news`(`id`,`title`,`keyword`,`desc`,`img_url`,`tag_id`,`content`,`view_count`,`add_time`,`show`,`hot`) values 
(1,'赛灵思自适应计算加速平台参与三星全球5G商用部','赛灵思,商用部','4月16日，赛灵思宣布与三星电子有限公司将采用Xilinx Versal自适应计算加速平台（ ACAP ）进行全球5G商用部署。赛灵思Versal ACAP提供了一个通用、灵活且可扩展的平台，能够满足多地区多运营商的需求。','uploads/img/20211203/5aeb94ef8e83e90faf5ad737b75a827f.jpg','6','<p><span style=\"font-size: 16px;\">4月16日，赛灵思宣布与三星电子有限公司将采用Xilinx Versal自适应计算加速平台（ ACAP ）进行全球5G商用部署。赛灵思Versal ACAP提供了一个通用、灵活且可扩展的平台，能够满足多地区多运营商的需求。</span></p><p>&nbsp;</p><p><span style=\"font-size: 16px;\">在相同频谱情况下，5G需要利用波束成形技术以将多个数据流同时传输给多个用户，波束成形技术需要更高计算密度与先进的高速连接（无论片上（on-chip）还是片外（off-chip）），才能满足5G的低时延需求。Versal ACAP是一个高度集成、多核、异构的计算平台，可以运行在5G的核心执行复杂的实时信号处理，包括用于增加网络容量的复杂波束成形技术。</span></p><p>&nbsp;</p><p><span style=\"font-size: 16px;\">据了解，Versal ACAP能够在低功耗下提供优异的计算密度，以执行波束成形算法所需的实时、低时延的信号处理。Versal AI Core系列中的A 引擎由平铺的矢量处理器阵列组成，这一特性使其成为实现所需数学运算功能，进而提供高计算密度、先进连接性，以及部署后可重编程与可重配置能力的理想选择。</span></p><p>&nbsp;</p><p><span style=\"font-size: 16px;\">三星电子网络业务执行副总裁兼研发主管Jaeho Jeon表示：“三星与赛灵思长期保持紧密协作，为强化我们在5G技术领域的领导地位并开辟5G新时代铺平了道路。现在，我们将赛灵思最新的先进平台应用于我们的解決方案，有望进一步提升5G性能，巩固我们在全球市场的领导地位。”</span></p><p><br/></p>',110,'2021-12-03 18:12:13',1,1),
(2,'124124214124',NULL,NULL,NULL,'1,8,9',NULL,7,'2021-12-13 16:55:40',1,1),
